    public int nearestExit1(char[][] maze, int[] entrance) {
        int x = maze.length;
        int y = maze[0].length;
        int[][] vis = new int[x][y];
        for (int[] a : vis) {
            Arrays.fill(a, -1);
        }
        LinkedList<int[]> list = new LinkedList<>();
        list.addLast(new int[]{entrance[0], entrance[1], 0});
        int count = 0;
        while (!list.isEmpty()) {
            int[] ints = list.pollFirst();
            int curX = ints[0];
            int curY = ints[1];
            int c = ints[2];
            if (vis[curX][curY] != -1) {
                continue;
            }
            vis[curX][curY] = count;
            if (curX == 0 || curY == 0 || (curY == y - 1) || curX == (x - 1)) {
                if (curX != entrance[0] || curY != entrance[1]) {
                    return c;
                }
            }
            if ((curX + 1) < x && maze[curX + 1][curY] != '+' && vis[curX + 1][curY] == -1) {
                list.addLast(new int[]{curX + 1, curY, c + 1});
            }
            if ((curX - 1) >= 0 && maze[curX - 1][curY] != '+' && vis[curX - 1][curY] == -1) {
                list.addLast(new int[]{curX - 1, curY, c + 1});
            }
            if ((curY + 1) < y && maze[curX][curY + 1] != '+' && vis[curX][curY + 1] == -1) {
                list.addLast(new int[]{curX, curY + 1, c + 1});
            }
            if ((curY - 1) >= 0 && maze[curX][curY - 1] != '+' && vis[curX][curY - 1] == -1) {
                list.addLast(new int[]{curX, curY - 1, c + 1});
            }
        }
        return -1;
    }

